import React, { Component } from 'react';
import { Navbar, Nav, NavItem, NavLink } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './Footer.css'

var style = {
    backgroundColor: "#F8F8F8",
    borderTop: "1px solid #E7E7E7",
    textAlign: "center",
    padding: "20px",
    // position: "fixed",
    left: "0",
    bottom: "0",
    height: "60px",
    width: "100%",
}

var phantom = {
  display: 'block',
  padding: '20px',
  height: '60px',
  width: '100%',
}

export default class Footer extends Component {
    render() {
        return (
         <div className="Footer1">
         <a href="https://www.instagram.com/weareone.exo/?hl=uk"><img  className="SNS" src="assets/insta.webp" alt="inst-logo" /></a>
         <a><img href="https://twitter.com/weareoneexo" className="SNS" src="assets/twt.png" alt="twt-logo" /></a>
         <a><img href="https://www.youtube.com/channel/UCzCedBCSSltI1TFd3bKyN6g" className="SNS" src="assets/youtube.png" alt="yt-logo" /></a>
         <a><img href="http://exo.smtown.com/" className="SNS" src="assets/logo.png" alt="exo-logo" /></a>
         <a><img href="https://www.smtown.com/" className="SNS" src="assets/SM.png" alt="sm-logo" /></a>
         </div>



        )
    }
}
